static uint16_t lcdkit_panel_init(uint16_t hw_id)
{
    uint16_t lcd_panel_id = DEFAULT_AUO_OTM1901A_5P2_1080P_VIDEO_DEFAULT_PANEL;
    hw_lcd_id_index lcd_hw_id = LCD_HW_ID_MAX;
    uint32_t i = 0;
    lcd_hw_id = (hw_lcd_id_index)hw_get_lcd_id(hw_id);

    dprintf(INFO,"lcd_panel_init lcd id = %d\n", lcd_hw_id);
    snprintf(lcd_id,sizeof(lcd_id), " huawei,lcd_panel_id = %X", lcd_hw_id);
    for (i = 0; i < ARRAY_SIZE(lcdkit_map); ++i) {
        if ((lcdkit_map[i].board_id == hw_id) && (lcdkit_map[i].gpio_id == lcd_hw_id)) {
            lcd_panel_id = lcdkit_map[i].lcd_id;
            break;
        }
    }

    return lcd_panel_id;
}

static void lcdkit_get_id_gpio(uint16_t hw_id, int* id0, int* id1)
{
    uint16_t i = 0;
    uint16_t def_id[] = {59,66};
    uint16_t id_gpio_grp[1][3] = {{0,0,0}};

    for (i = 0; i < 1; i++)
    {
        if (hw_id == id_gpio_grp[i][2])
        {
            *id0 = id_gpio_grp[i][0];
            *id1 = id_gpio_grp[i][1];
            return;
        }

    }

    if (i >= 1)
    {
        *id0 = def_id[0];
        *id1 = def_id[1];
    }

    return;
}


